    // });
    $("#rated").rating().on("rating:change", function(event, value, caption) {
      var user_id = $(this).attr('data-user-id');
      var vote = $(this).attr('value')

      $.ajax({
        type: 'post',
        url: '/users/' + user_id + '/rate',
        data: {rating: vote}
      });
  });
})
